import React from 'react'
import Navbar from './Navbar';
import { makeStyles } from '@material-ui/core/styles';
import {
    Box,
    Grid,
    Card,
    CardActionArea,
    CardActions,
    CardContent,
    CardMedia,
    Button,
    Typography
} from "@material-ui/core";
import project1 from "../images/html-css-javascript-lg.jpg"

const useStyles = makeStyles({
    mainContainer: {
        background: "#233",
        height: "100%"
    },
    cardContainer: {
        maxWidth: 345,
        margin: "5rem auto"
    }
});

const Portfolio = () => {
    const classes = useStyles();

    const redirect = (url) => {
        window.location.href = url;
    }

  return (
    <Box component="div" className={classes.mainContainer}>
    <Navbar/>
    <Grid container justify="center">
        {/* Project 1 */}
        <Grid item xs={12} sm={8} md={6}>
        <Card className = {classes.cardContainer}>
                <CardMedia
                component = "img"
                alt= "Project 1"
                height="140"
                image = {project1}
                />
                <CardContent>
                    <Typography gutterBottom variant="h5">
                      Quadruped Robot
                    </Typography>
                    <Typography variant="body2" color="textSecondary" components="p">
                    Led a team of engineers to design, construct, and program a sophisticated, walking quadruped robot using Python for the software, 3D printed materials for the body, and a Raspberry Pi as the motherboard
                    </Typography>
                </CardContent>
                <CardActions>
                    <CardActionArea>
                    <Button size = "small" color = "black" onClick={() => redirect("https://github.com/UCLAX1/Boelt-Software")}>
                        View Code
                    </Button>
                    </CardActionArea>
                    <CardActionArea>
                    <Button size = "small" color = "black">
                        View More Info
                    </Button>
                    </CardActionArea>
                </CardActions>

        </Card>
        </Grid>
    </Grid>
    </Box>
  );
};

export default Portfolio
